import React from "react";
import { Card } from "antd";

const PostCard = ({ post }) => {
  return (
    <>
      <Card cover={post.images[0] && <PostImages images={post.imges} />}>
        <Image />
        <Content />
        <Button></Button>
      </Card>
      <CommentForm />
      <Comments />
    </>
  );
};

export default PostCard;
